export interface Character {
    id: number;
    icon?: string;
    image?: string;
    name: string;
    element: string;
    fetter: number;
    level: number;
    rarity: number;
    actived_constellation_num: number;
    weapon?: Weapon;
    reliquaries?: Reliquaries[];
    constellations?: Constellations[];
}
export interface Weapon {
    id: number;
    name: string;
    icon: string;
    type: number;
    type_name: string;
    desc: string;
    rarity: number;
    level: number;
    promote_level: number;
    affix_level: number;
}
export interface Reliquaries {
    id: number;
    name: string;
    icon: string;
    pos: number;
    pos_name: string;
    rarity: number;
    level: number;
    set: {
        id: number;
        name: string;
        affixes: {
            activation_number: number;
            effect: string;
        }[];
    };
}
export interface Constellations {
    id: number;
    name: string;
    icon: string;
    effect: string;
    is_actived: boolean;
    pos: number;
}
